// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

// The YourToken contract implements a basic ERC20 token with additional functionalities like burning tokens.
contract YourToken {
    // Token details
    string public name;       // Name of the token
    string public symbol;     // Symbol of the token
    uint8 public decimals = 18; // Number of decimals for the token
    uint256 public totalSupply; // Total supply of tokens

    // Mappings to keep track of token balances and allowances
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    // Events to notify about transfers and approvals
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    // Constructor to initialize the token with name, symbol, and initial supply
    constructor(string memory _name, string memory _symbol, uint256 _initialSupply) {
        name = _name;
        symbol = _symbol;
        totalSupply = _initialSupply * (10 ** uint256(decimals)); // Set total supply considering decimals
        balanceOf[msg.sender] = totalSupply; // Assign total supply to the contract deployer
    }

    // Function to transfer tokens from the caller to another address
    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "Insufficient balance"); // Check if sender has enough balance
        balanceOf[msg.sender] -= _value; // Deduct tokens from sender
        balanceOf[_to] += _value; // Add tokens to receiver
        emit Transfer(msg.sender, _to, _value); // Emit Transfer event
        return true;
    }

    // Function to approve another address to spend tokens on behalf of the caller
    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value; // Set allowance for spender
        emit Approval(msg.sender, _spender, _value); // Emit Approval event
        return true;
    }

    // Function to transfer tokens from one address to another using an allowance
    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceOf[_from], "Insufficient balance"); // Check if sender has enough balance
        require(_value <= allowance[_from][msg.sender], "Allowance exceeded"); // Check if allowance is sufficient
        balanceOf[_from] -= _value; // Deduct tokens from sender
        balanceOf[_to] += _value; // Add tokens to receiver
        allowance[_from][msg.sender] -= _value; // Decrease allowance
        emit Transfer(_from, _to, _value); // Emit Transfer event
        return true;
    }

    // Function to burn tokens from the caller's balance
    function burn(uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "Insufficient balance"); // Check if caller has enough balance
        balanceOf[msg.sender] -= _value; // Deduct tokens from caller
        totalSupply -= _value; // Decrease total supply
        emit Transfer(msg.sender, address(0), _value); // Emit Transfer event to address(0) indicating burn
        return true;
    }
}
